import styled from 'styled-components';

const Header = styled.div`
  background-color: #fff;
  grid-area: header;
  border-top-right-radius: 8px;
  border-bottom: 1px solid rgba(0, 0, 0, 0.2);
  z-index: 10;
`;

export default Header;
